import React from 'react';
import './App.css';
import './uikit.css'
import { BrowserRouter as Router, Route} from "react-router-dom";
import NavBar from './NavBar'
import Search from './Search'
import SignUp from './SignUp'
import Logout from './Logout'


class App extends React.Component {

  constructor() {
    super()

    this.state = {
      isLoggedIn: false
      }
  }

  handleIsLoggedIn = () => {
    this.setState({
      isLoggedIn: !this.state.isLoggedIn
    })
  }
  render() {
    return (
      <div className="App">
        <Router>
          <NavBar handleLoggedIn={this.state.isLoggedIn}/>
          <Route path='/search' render={() => <Search handleLoggedIn={this.handleIsLoggedIn}/>} />
          <Route path='/sign-up' render={() => <SignUp handleLoggedIn={this.handleIsLoggedIn}/>} />
          <Route path='/logout' render={() => <Logout handleLoggedIn={this.handleIsLoggedIn}/>} />
        </Router>
      </div>
    )
  };
}

export default App;
